const NewsfeedPage = () => {

    const [posts, setPosts] = useState()

    return (
       <Container>
           <Aside>left</Aside>
           <Newsfeed>posts</Newsfeed>
           <Aside>left</Aside>
       </Container>
    );
};

export default NewsfeedPage;
